import React, { useState, useEffect } from "react";

import "./Domains.scss";

Modal.setAppElement("#root");

const Domains = ({ img, alt, title }) => {
  return (
    <div class="main-item" >
      <img class="img" src={img} alt={alt} />
      <h1>{title}</h1>
    </div>
  );
};

export default Domains;
